import "./consult.css";
import img1 from "./images/ankur.jpg";
import img2 from "./images/akshat.jpg";
import img3 from "./images/ashad.jpg";
import img4 from "./images/bg_img.webp";

import "./medicines.css";
const img = [img1, img2, img3, img4];

export default function Consult() {
    return (
        <div className="consultPage">
            <div className="topPage">
                <div className="form">
                    <span>First Name</span>
                    <input className="firstName formInput" type="text" />
                    <span>Last Name</span>
                    <input className="lastName formInput" type="text" />
                    <span> Date of Appointment</span>
                    <input className="date formInput" type="date" />
                    <span>City</span>
                    <input className="cityName formInput" type="text" />
                    <span>State</span>
                    <select className="choose formInput" name="state" id="">
                        <option value="">Choose...</option>
                    </select>
                    <span>Problem</span>
                    <input className="problem formInput" type="text" />
                    <span>Agree to Terms and Conditions</span>
                    <button>Book Apointment</button>
                </div>
            </div>
            <div className="bottomPage">
                <h2 className="bottomPageHeading">Our Doctors</h2>
            </div>
        </div>
    );
}
